import React from "react";
import classes from "./Footer.module.css";
import logo from '../../img/logo-187x66.png';

const  Footer = () =>{
    return (
        <div className={classes.block}>
            <img src={logo} alt="logotype"/>
            <div>
                <span></span>
            </div>
        </div>
    );
};

export default Footer;
